import React from "react";
import Data from "../../Data";
import Slider from "react-slick";
const Slide = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
      };
  return (
    <div>
          <Slider {...settings}>
            <div className="flex">

      {Data.map((a, b) => {
        return (
          <div className="flex">
            <h1>{a.name}</h1>
            <h1>{a.class}</h1>
            <h1>{a.sdfd}</h1>
          </div>
        );
      })}
      </div>
      </Slider>
    </div>
  );
};

export default Slide;
